import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To make the view mode buttons appear, we first need to perform a search.
    // 1. Fill the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.locator('#searchInput').fill('electronics');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // 2. Click the search button
    // There are multiple search buttons, we select the one next to the input.
    await page.locator('.search-container .search-btn').click();

    // 3. Wait for search results and view toggle buttons to be visible
    await page.waitForSelector('.view-toggle', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_grid_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_grid_view.png'));

    // 4. Click the "List View" button
    const listViewButton = page.getByTitle('List View');
    await listViewButton.click();

    // 5. Wait for the product container to switch to list view mode
    await page.waitForSelector('.products-list', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_list_view.png'));

    // 6. Verify the switch by checking if the button has the 'active' class
    const isListViewActive = await listViewButton.evaluate(node => node.classList.contains('active'));
    const productsContainerClass = await page.locator('.products-list').getAttribute('class');

    return {
      success: true,
      action: "Switched product display to List View mode.",
      extractedData: {
        isListViewActive: isListViewActive,
        productsContainerClass: productsContainerClass
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View mode.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
